import './App.css';

function App() {
  return (
    <h1>test</h1>
  );
}

function Parent() {
  return (
    <div className="parent">
      <h2>I'm your parent.</h2>
    </div>
  );
}

function Child() {
  return (
    <div className="child">I am your child.</div>
  );
}

export default App;
